import '../stylesheets/App.scss';
import React from 'react';

const App = () => {
  return (
    <div className="App">
      <header className="header">
        <h1 className="headerTitle">Componentes: Lista de Adalabers</h1>
      </header>
      <aside className="topBanner"></aside>
    </div>
  );
};

export default App;
